var transformData=function(r){var a={title:r.summary,start:r.start,end:r.end,url:r.url,className:r.is_current_user?"know-cue":"know-ue",backgroundColor:r.is_current_user?"rgba(0, 0, 0, 0.0)":"rgba(100, 0, 0, 0.3)",borderColor:r.is_current_user?"rgba(100, 0, 0, 0.3)":"rgba(0, 0, 0, 0.0)",textColor:r.is_current_user?"rgba(100, 80, 80, 0.3)":"white"};return a};$(document).on("page:change",function(){$("#calendar").fullCalendar({events:"/schedule/list.json",eventDataTransform:transformData,aspectRatio:2})});